import React, { useState } from 'react'
import './domain.css'

export default function Finance() {

  const [answers, setAnswers] = useState({
    area: '',
    tasks: '',
    chatbot: '',
    insurance: '',
    geography: '',
    software: '',
    userLoad: '',
    payments: '',
    documentManagement: '',
    transactions: '',
  });

  const [submitted, setSubmitted] = useState(false);

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setAnswers({ ...answers, [name]: value });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    setSubmitted(true);
    history.push('/answers');
  };

  const redirectToForm = () => {
    window.location.href = '/answers'
  }


  return (
    <div className="fm">
        <form>
            <center><h1 className="title">Financial Services</h1></center>
            <div className="qns">
              <center><h1>Fill the following</h1></center>
                <label><b>1. What area of financial services are you interested in?</b></label><br/>
                <input type="checkbox" name="" value="" /> Banking <br />
                <input type="checkbox" name="" value="" /> Investment and wealth management <br />
                <input type="checkbox" name="" value="" /> Insurance <br />
                <input type="checkbox" name="" value="" /> Not sure <br />
                <label><b>2. What tasks or activities do you want to accomplish using cloud services?</b></label><br/>
                <input type="checkbox" name="" value="" /> Customer Identity and Access Management <br />
                <input type="checkbox" name="" value="" /> Fraud Detection and Prevention <br />
                <input type="checkbox" name="" value="" /> Financial Mobile Apps     <br />
                <input type="checkbox" name="" value="" /> Hosting Website <br />
                <label><b>3. Would you like to implement a financial chatbot for customer inquiries and support?</b></label><br/>
                <input type="radio" name="r1" value="r1" />Yes  <input type="radio" name="r1" value="r1" />No <br />
                <label><b>4. Are you looking for a system to manage and track insurance claims and customer policy details?</b></label><br/>
                <input type="radio" name="r2" value="r2" />Yes  <input type="radio" name="r2" value="r2" />No <br />
                <label><b>5. What is the expected geographical distribution of your users?</b></label><br/>
                <input type="checkbox" name="" value="" /> Local / Regional <br />
                <input type="checkbox" name="" value="" /> National <br />
                <input type="checkbox" name="" value="" /> Global <br />
                <label><b>6. Do you have any existing software?</b></label><br/>
                <input type="radio" name="r3" value="r3" />Yes  <input type="radio" name="r3" value="r3" />No <br />
                <label><b>7. What is your expected user load? </b></label><br/>
                <input type="radio" name="r4" value="r4" /> A few hundred users (&gt;100) <br/> <input type="radio" name="r4" value="r4" />Thousands of users (&gt; 1000) <br />
                <input type="radio" name="r4" value="r4" />Millions of users (&gt; 10000) <br/> <input type="radio" name="r4" value="r4" />Uncertain <br />
                <label><b>8. Are you looking to use a cloud solution for handling payments and currency exchange across borders?</b></label><br/>
                <input type="radio" name="r5" value="r5" />Yes  <input type="radio" name="r5" value="r5" />No <input type="radio" name="r5" value="r5" />Not sure <br />
                <label><b>9. Would you like to implement a system for secure document management and collaboration among your financial team and clients?</b></label><br/>
                <input type="radio" name="r6" value="r6" />Yes  <input type="radio" name="r6" value="r6" />No <br />
                <label><b>10. Do you require cloud tools for managing customer financial transactions and accounting?</b></label><br/>
                <input type="radio" name="r7" value="r7" />Yes  <input type="radio" name="r7" value="r7" />No <br />
                <center><button className="btn1" onClick={handleInputChange}>Submit</button></center>
            </div>
        </form>
        {submitted && {redirectToForm}}
    </div>
  )
}
